import math

def calculate_f(k):
    F = 1
    for n in range(1, k + 1):
        f_n = 0
        for d in range(1, int(math.sqrt(n)) + 1):
            if n % d == 0:
                f_n += math.gcd(d, n // d)
                if d != n // d:
                    f_n += math.gcd(n // d, d)
        F += f_n
    return F

